export class Inputs extends Component {
    constructor() {
        super()
        this.state = {
            firstName: "",
            lastName: "",
            birthDate: ""
        }
    }
    render() {
        return (
            <div>
                <input placeholder="First name"></input>
                <input placeholder="Last name"></input>
                <input placeholder="Date of birth" type='date'></input>
            </div>)
    }
}
